      <Grid
        container
        spacing={24}
        direction="row"
        justify="center"
        alignItems="center"
      >
        <Card>
          <CardHeader classes={{ title: classes.label }} title="On Exchange" />
          <CardContent>
            {this.state.inputJsonOnExchange.map((card, i) => (
              <div>
                <TextField
                  disabled
                  key={card.id}
                  id="standard-disabled"
                  variant="standard"
                  className={classes.textField}
                  value={card.StateName}
                  margin="normal"
                />
                <TextField
                  required
                  id="standard-name"
                  variant="standard"
                  className={classes.textField}
                  label="TPA ID"
                  value={card.tpaId}
                  onChange={this.handleChange(card.id, card.tpaId)}
                  margin="normal"
                />
              </div>
            ))}
          </CardContent>
        </Card>
        <br />
        <br />
